import React, { Component } from 'react';
import Home from './home/Home'

export class Body extends Component {
  render() {
    return (
      <div style={{background:'pink', height:'100%'}}>
        <div style={{background:'white', width:'80%', height:'600px', margin:
    '0 auto'}}>
            <Home />
        </div>
      </div>
    )
  }
}

export default Body;
